view: ability {
  sql_table_name: "ECOMMERCE"."ABILITY"
    ;;

  dimension: pk {
    type: number
    sql: ${TABLE}."PK" ;;
  }

  measure: count {
    type: count
    drill_fields: []
  }
}

view: owners {
  dimension: id {
    primary_key: yes
    sql: ${TABLE}.id ;;
  }
  dimension: owner_name {
    sql: ${TABLE}.owner_name ;;
  }
}

explore_source: my_view_explore {
  bind_all_filters: yes

  column: country {
    field: my_view_explore.country
  }

  column: city {
    field: my_view_explore.city
  }

  column: is_latest {
    field: my_view_explore.is_latest
  }

  derived_column: derived_col {
    sql: coalesce(country, 'US') ;;
  }
}

view: flights {
  sql_table_name: flightstats.accidents ;;

  dimension: id {
    label: "id"
    primary_key: yes
    type: number
    sql: ${TABLE}.id ;;
  }
}

# override type of id parameter
view: +flights {
  dimension: id {
    label: "id"
    primary_key: yes
    type: string
    sql: ${TABLE}.id ;;
  }
}
